create table qualifying
(
    "qualifyId"     integer not null
        constraint qualifying_pk
            primary key,
    "raceId"        integer
        constraint qualifying_races_raceid_fk
            references races,
    "driverId"      integer
        constraint qualifying_drivers_driverid_fk
            references drivers,
    "constructorId" integer
        constraint qualifying_constructors_constructorid_fk
            references constructors,
    number          integer,
    position        integer,
    q1              text,
    q2              text,
    q3              text
);

alter table qualifying
    owner to root;

create unique index qualifying_qualifyid_uindex
    on qualifying ("qualifyId");

